description:
Siemens Solid Edge ST8

x64 only

Language: English

Build: TeAM SolidSQUAD-SSQ


Instructions:

1- Emulate the iso file inside the English folder;
2 - Install Solid Edge;
3- Copy the files inside the folder program that are inside the folder Solidsquad;
4- Paste the files inside the folder Program in the directory of the installed solid edge in C:. (replace some files, if it's necessary);
5- Run Solid Edge, choose the 1st option, find the SElicense.dat file inside the folder Program (C:Program FilesSolid Edge ST8Program);
6- It's done!


